import React from 'react'

const NotFound = () => {
    return (
        <div>
            <div id="wrapper">
                <img src="https://i.imgur.com/qIufhof.png" />
                <div id="info">
                    <h3>This page could not be found</h3>
                </div>
            </div >
            )
        </div>
    )
}

export default NotFound
